// MenuPage.js
import React from 'react';
import CategorySelector from './CategorySelector';

const MenuPage = ({ categories, showProducts, goBack }) => {
  return (
    <div>
      <h1>Menu</h1>
      <CategorySelector categories={categories} showProducts={showProducts} />
      <button onClick={goBack}>Back to Landing Page</button>
    </div>
  );
};

export default MenuPage;
